다 기승전결이 있는거지 뭐 맨날 동태가 이겨야하고
적들 순삭 시켜야하고 그래야되냐;;;
그럴거면 그냥 "이제 안봄 ㅡㅡ" 이런 댓글 달 시간에 다른 만화 보러가요;; 님들이 원하는 먼치킨류 만화들 많으니까;;

그럴거면 애초에 웹툰에 들어오지를 마세요
