댓글 보고나서 아차 싶었음..전화가 어디까지 나갔었는지를..

애들 한두명이 저러니까 물타기해서 말하는 꼬라지봐라;;;
보기싫으면 보지 마 여기서 그러지 말고 좀;
니네 생각 말하는건데 뭐가 문제냐 뭐냐 이러면서 태클걸려하지마 ㅎㅎ 인생패배자들이라 그런지 한두명이 하는거 따라서 물타기하면 일침날린줄아네;
애초에 11시에 나오는건 맞는데 일요일웹툰이 토요일이 아니라 일요일에 나오는게 문제인거냐?
솔직히 요즘 네티즌들 연령대가 낮아진거같긴 한데 맨날 한두명이 일침날리는거 보고 물타기해서 똑같이 저러고
그래 물론 니네가 말하는게 맞는것도 있겠지 근데 레알 역겨워 니네;
